import React, {useEffect, useState} from 'react'


const Profile = ()=>{
    const [mypics,setPics] = useState([])
    useEffect(()=>{
        fetch('/mypost',{
            headers:{
                "Authorization":"Bearer "+localStorage.getItem("jwt")
            }
        }).then(res=>res.json())
        .then(result=>{
            setPics(result.mypost)
        })
    },[])
    return(
        <div style={{maxWidth:"550px",margin:"0px auto"}}>
            <div style={{
                display:"flex",
                justifyContent:"space-around",
                margin:"18px 0px",
                borderBottom:"1px solid grey"
            }}>
                <div>
                    <img style = {{width:"160px",height:"160px",borderRadius:"80px"}}
                    src="https://images.unsplash.com/photo-1592821166384-8130a978709c?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxzZWFyY2h8MTM3fHxwZXJzb258ZW58MHwyfDB8&auto=format&fit=crop&w=600&q=60"/>
                </div>
                <div>
                    <h4>Mike Ross</h4>
                    <div style={{display:"flex",
                    justifyContent:"space-between",
                    width:"108%",
                    }}>
                        <h6>40 posts</h6>
                        <h6>40 followers</h6>
                        <h6>40 following</h6>
                    </div>
                </div>
            </div>
            
            <div className="gallery">
                {
                    mypics.map(item=>{
                        return(
                            <img className="item" src={item.photo} alt={item.title}/>
                        )
                    })
                }
            </div>
        
        
        </div>
    )
}

export default Profile
